function MiLista(props){
    return(
        <div>
            <h1>Mi Lista</h1>
            <h4>Lista de (props.titulo)</h4>
            <ul>
                <li>(props.nombre1)</li>
                <li>(props.nombre2)</li>
                <li>(props.nombre3)</li>
                <li>(props.nombre4)</li>
            </ul>
        </div>
    )
}
    

export default MiLista;
